import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  tab: {
    paddingVertical: 17,
    flex: 1,
    borderLeftWidth: 1,
    borderColor: 'lightgrey',
  },
  icon: {
    textAlign: 'center',
  },
});
